import React from 'react';
import {Link} from "react-router-dom";

class ReviewHome extends React.PureComponent {

    render() {
        return (
            <div className="guarantee">
                <div className="container">
                    <div className="row">
                        <div className="col-12 text-center">
                            <h1 className="d-block d-sm-block d-md-none">{t("home:Register")}</h1>
                            <img src={process.env.PUBLIC_URL + '/assets/images/home/guarantee.svg'}
                                 alt="guarantee"/>
                            <h1>{t("home:Satisfaction Guaranteed")}</h1>
                            <h2>{t("home:Cancel the service for a full refund up to a period of 30 days.")}</h2>
                            <div className="d-block d-sm-block d-md-none">
                                <Link to={(i18n.language !== "th" ? "/" + i18n.language : "") + "/register"}>
                                    <button className="btn btn-primary registration">
                                        {t("home:Register")}
                                    </button>
                                </Link>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        )
    }
}

export default ReviewHome;
